export async function getImages(key) {
  let body = {key: key};
  console.log('this is the body: ', body);
  let req = await fetch('https://localhost:5000/get-images', )
  .catch(err => {
    console.log('error: ', err);
  });
  console.log('this is the res: ', req);
  return req;
}
